var generateIdFilter = function generateIdFilter(id, wildcard) {
    var result = id;
    if (wildcard === true) {
        var parts = id.split("@");
        var match_id = parts[0];
        result = function(event) {
            if (event.id === undefined) {
                return false;
            }
            return event.id === id || event.id.substring(0, match_id.length + 1) == match_id + "@";
        };
    }
    return result;
};

